import React from 'react';
import {StyleSheet, View} from 'react-native';

export const Container = ({ children }) => {

    return (
        <View style={styles.container}>
            {children}
        </View>
    )
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        backgroundColor: '#F2F2F2',
        paddingLeft: 20,
        paddingRight: 20,
    },
});
